import React, { useEffect, useState } from 'react'
import API from '../utils/API';
import MovieCard from '../components/MovieCard/MovieCard'


export default function Homepage() {
    const [data, setData] = useState([])

    useEffect(() => {
        loadMovies();
    }, []
    );

    function loadMovies() {
        API.getMovies()
            .then(res => {
                console.log(res.data)
                let madeArr = Object.entries(res.data)
                console.log(madeArr)

                setData(res.data.toArray)
            })
            .catch(err => console.log(err))
    }


    return (
        <>
            <div>
                {madeArr ? madeArr.map(movie => {
                    return (
                        <MovieCard
                            key={movie.id}
                            poster={movie.poster}
                            title={movie.title}
                            year={movie.year}
                            rated={movie.rated}
                            awards={movie.awards}
                        />
                    )
                }) : <h2>No data found</h2>}
            </div>



        </>
    )
}
